//parceiro.co.jp/ladies/",introduction:"ACはアスレチッククラブの略。PARCEIRO（パルセイロ）とは、ポルトガル語で「パートナー」の意味。レディースチームのモットーは「明るく元気に笑顔で」です。アグレッシブに前線からプレスを仕掛け、粘り強く走って戦います。"},三菱重工浦和レッズレディース:{id:"urawa",name:"三菱重工浦和レッズレディース",shortName:"浦和",category:"WEリーグ",region:"埼玉県",homeStadium:"浦和駒場スタジアム",website:"https://www.urawa-reds.co.jp/ladies/",introduction:"2005年に浦和レッズの女子チームとして「浦和レッドダイヤモンズレディース」が誕生。2021年3月に「三菱重工浦和レッズレディース」に呼称を変更、WEリーグに参入しました。今季はリーグ3連覇、AFC女子チャンピオンズリーグ、皇后杯など全タイトル獲得を目指します。"},サンフレッチェ広島レジーナ:{id:"hiroshima",name:"サンフレッチェ広島レジーナ",shortName:"広島",category:"WEリーグ",region:"広島県",homeStadium:"エディオンスタジアム広島",website:"https://www.sanfrecce.co.jp/regina/",introduction:"チーム名の「REGINA（レジーナ）」は、イタリア語で「女王」を意味し、「RE」SPECT、「GI」RLS、「NA」VIGATORという三つのコンセプトを含んでいます。創設4年目を迎えた今年、吉田監督の下、初優勝を目指します。"},ちふれASエルフェン埼玉:{id:"chifure",name:"ちふれASエルフェン埼玉",shortName:"埼玉",category:"WEリーグ",region:"埼玉県",homeStadium:"熊谷スポーツ文化公園陸上競技場",website:"https://www.as-elfen.co.jp/",introduction:"1985年に狭山市で地域の少女チーム「アゼィリアFC」として発足しました。昨年度の皇后杯では、ベスト4という過去最高成績を収めました。今年度は「もっと激しく、速く、美しく」のスローガンの下、過去最高順位を目指します。"},INAC神戸レオネッサ:{id:"inac",name:"INAC神戸レオネッサ",shortName:"INAC神戸",category:"WEリーグ",region:"兵庫県",homeStadium:"ノエビアスタジアム神戸",website:"https://inac-kobe.com/",introduction:"2001年4月に創設。「INAC」はInter NationalAthletic Clubの略で、「レオネッサ」は雌ライオンを意味し、美しさと力強さを表しています。「神戸から世界へ」をコンセプトに世界で戦える選手の輩出を目指して活動しています。"},"ジェフユナイテッド市原・千葉レディース":{id:"jef",name:"ジェフユナイテッド市原・千葉レディース",shortName:"千葉",category:"WEリーグ",region:"千葉県",homeStadium:"フクダ電子アリーナ",website:"https://jefunited.co.jp/teams/ladies/",introduction:"地域の要望により1992年に発足。2000年よりLリーグに参戦し、2009年に1部昇格。千葉県の女子サッカーの普及発展に貢献すると同時に、社会で活躍する女性の育成も視野に入れて活動しています。過去2回の準優勝を上回る、念願の頂点を目指します。"},セレッソ大阪ヤンマーレディース:{id:"cerezo",name:"セレッソ大阪ヤンマーレディース",shortName:"C大阪",category:"WEリーグ",region:"大阪府",homeStadium:"ヨドコウ桜スタジアム",website:"https://www.cerezo.jp/ladies/",introduction:"2010年に女子チームが発足し、2013年からなでしこリーグに加盟しました。2023年のWEリーグ参入を期に、チーム名をセレッソ大阪ヤンマーレディースに変更しました。セレッソ大阪の下部組織から育てた選手を中心にチームを構成しています。"},バニーズ群馬FCホワイトスター:{id:"gunma",name:"バニーズ群馬FCホワイトスター",shortName:"群馬",category:"なでしこリーグ1部",region:"群馬県",homeStadium:"NA",website:"https://whitestar-sportsclub.com/",introduction:"2007年発足。前橋市を中心に群馬県全域で活動しています。今季は存続の危機、2部降格という厳しい経験をしましたが、野田新監督を迎えた皇后杯は、来季の1部復帰に向けた第一歩として、クラブ一丸となり新体制で挑みます。"},オルカ鴨川FC:{id:"kamogawa",name:"オルカ鴨川FC",shortName:"鴨川",category:"なでしこリーグ1部",region:"千葉県",homeStadium:"NA",website:"https://www.orcakamogawafc.com/",introduction:"2014年発足。「オルカ」とは大海原の王者シャチの学名に由来し、強く堂々と突き進むクラブになりたいという思いが込められています。地域と共に歩み、シャチのようにダイナミックに高みを目指してたくましく戦います。"},スフィーダ世田谷FC:{id:"sfida",name:"スフィーダ世田谷FC",shortName:"世田谷",category:"なでしこリーグ1部",region:"東京都",homeStadium:"NA",website:"http://www.sfida.or.jp/",introduction:"トップチーム（なでしこリーグ1部所属）をピラミッドの頂点に、育成・強化を目的とするアカデミー（中学生・高校生）、普及を目的とする小学生・ママさん、ブラインドサッカーチームなど合計約200名が所属する日本最大規模の女子サッカークラブです。"},日体大SMG横浜:{id:"ntdau",name:"日体大SMG横浜",shortName:"日体大",category:"なでしこリーグ1部",region:"神奈川県",homeStadium:"NA",website:"https://www.nssusmg.com/",introduction:"母体となる「日本体育大学サッカー部」、「地域」の理解と協力、「企業・団体」の共感と支援、それぞれの境界を譲り合いながら受け入れ、交わり合って境界が溶け出し、スポーツを通して実現する平和・幸せの架け橋として横浜市青葉区を拠点に活動しています。"},ニッパツ横浜FCシーガルズ:{id:"nippats",name:"ニッパツ横浜FCシーガルズ",shortName:"横浜",category:"なでしこリーグ1部",region:"神奈川県",homeStadium:"NA",website:"https://seagulls.yokohamafc-sc.com/",introduction:"Ｊクラブと地域クラブの提携で2013年に発足し、神奈川県横浜市を拠点に活動しています。2016年から日本発条株式会社（ニッパツ）とパートナー契約を結び、チーム名を「ニッパツ横浜FCシーガルズ」とし、2021年からなでしこリーグ1部で戦っています。"},静岡SSUボニータ:{id:"shizuoka",name:"静岡SSUボニータ",shortName:"静岡",category:"なでしこリーグ1部",region:"静岡県",homeStadium:"NA",website:"https://shizuoka-ssu.com/",introduction:"2008年に発足し、2010年に日本女子サッカーリーグに参入しました。サッカーで人が動き、つながり、感動できるような活動を目指し、チームに関わる全ての人々が幸せになることを願い、地域社会の活性化に貢献したいという強い思いがあります。"},"朝日インテック・ラブリッジ名古屋":{id:"lovridge",name:"朝日インテック・ラブリッジ名古屋",shortName:"名古屋",category:"なでしこリーグ1部",region:"愛知県",homeStadium:"NA",website:"https://loveledge.jp/",introduction:"ラブリッジとは愛「LOVE」と知「KNOWLEDGE」をかけ合わせた造語です。女子サッカー界の発展、女性アスリートの地位向上などを理念としています。今年6月より専用グラウンド「朝日インテックWOVENFIELD」（瀬戸市）にて練習しています。"},伊賀FCくノ一三重:{id:"iga",name:"伊賀FCくノ一三重",shortName:"伊賀",category:"なでしこリーグ1部",region:"三重県",homeStadium:"NA",website:"https://www.igafc.jp/",introduction:"三重県伊賀市を拠点に創部48年目を迎えた市民クラブ。歴史ある伊賀の地で女子サッカーの普及・振興、地域に根差したクラブづくりを目指しています。チームは、今シーズンのスローガンである「進化　心ひとつに」、また強みであるチーム力と全員攻撃を生かしたサッカーで皇后杯でも優勝を目指して一丸となって戦います。"},スペランツァ大阪:{id:"esperanca",name:"スペランツァ大阪",shortName:"大阪",category:"なでしこリーグ1部",region:"大阪府",homeStadium:"NA",website:"https://www.speranzafc.jp/",introduction:"「スペランツァ」とはイタリア語で「希望」を意味します。2022年から大阪全域での活動を見据え「スペランツァ大阪」と改称、2024年に河内長野市へ本拠地を移し、夢・希望・元気を皆さまと共有して地域とスポーツが共存共栄できるクラブを目指します。"},ASハリマアルビオン:{id:"harima",name:"ASハリマアルビオン",shortName:"ハリマ",category:"なでしこリーグ1部",region:"兵庫県",homeStadium:"NA",website:"https://h-albion.jp/",introduction:"クラブ名は、播磨の国の文献に残る巨人伝説と、ギリシャ神話の巨人「アルビオン」が由来。地元企業と連携したキッズサッカー教室や、J1ヴィッセル神戸と連携した小学校巡回指導、その他地域貢献・SDGs活動など、幅広い年代と地域に愛されるチームとして、引き続き女子サッカーの普及・発展に貢献していきます。"},愛媛FCレディース:{id:"ehime",name:"愛媛FCレディース",shortName:"愛媛",category:"なでしこリーグ1部",region:"愛媛県",homeStadium:"NA",website:"https://ehimefc.com/ladies.html",introduction:"愛媛県全域をホームタウンとする愛媛FC。レディースチームは、2011年に結成しました。愛媛県民に夢・感動・希望を与えられるよう、県民クラブとしての自覚とJリーグクラブの女子チームとしての矜持を胸に、愛媛の誇りとなれるよう活動しています。"},ヴィアマテラス宮崎:{id:"viamaterasu",name:"ヴィアマテラス宮崎",shortName:"宮崎",category:"なでしこリーグ1部",region:"宮崎県",homeStadium:"NA",website:"https://www.miyazakisports.jp/",introduction:"「スポーツを通じて、夢や希望をはぐくみ、一人ひとりが輝く、活気ある街づくりに貢献する」という理念の下、2020年に宮崎県新富町をホームタウンとして発足。宮崎から広く人々を照らす存在となり、その姿が宮崎県民の力になることを目指しています。"},札幌大学ヴィスタ:{id:"sapporo",name:"札幌大学ヴィスタ",shortName:"札幌",category:"地域代表",region:"北海道",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/18.html",introduction:"サッカーを通じて自ら考え、主体的に行動し、社会で必要とされる人材となれるよう日々努力し、活動しています。今年度は「去年を超えるチームになる」をチームコンセプトに掲げ、活動してきました。選手・スタッフが一丸となって最後まで戦います。"},JFAアカデミー福島:{id:"fukushima",name:"JFAアカデミー福島",shortName:"福島",category:"地域代表",region:"東北",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/06.html",introduction:"2006年、福島県双葉郡楢葉町に開校。東日本大震災により静岡県に一時移転していましたが、今年の3月、13年ぶりに福島県での活動を再開しました。常に世界基準を意識して、テクニックの質にこだわりながらトレーニングに励んでいます。"},マイナビ仙台レディースユース:{id:"sendai-youth",name:"マイナビ仙台レディースユース",shortName:"仙台ユース",category:"地域代表",region:"東北",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/42.html",introduction:"マイナビ仙台レディースのアカデミーとして「日本でいちばん、『ひと』が育つクラブ」をコンセプトに活動しています。強く生き生きとしたプレーと常に勝利を目指し続ける姿で、見る人に勇気と感動を届け、創設6年目で2度目の出場となる今大会を楽しみます。"},VONDS市原FCレディース:{id:"ichihara",name:"VONDS市原FCレディース",shortName:"市原",category:"地域代表",region:"関東",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/41.html",introduction:"市原市を拠点とし2017年に創設されました。仕事とサッカーの両立に励み、積極的に市内のイベントに参加することで、市民の方々に身近に感じられ愛されるクラブづくりを目指しています。関東女子サッカーリーグ1部に所属し、なでしこリーグ昇格を目指して戦っています。"},大和シルフィード:{id:"yamato",name:"大和シルフィード",shortName:"大和",category:"地域代表",region:"関東",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/29.html",introduction:"1998年に中学生チームとして創設以降、多くの日本女子代表やなでしこリーグ選手を輩出してきました。2014年にトップチームを編成し、2019年シーズンからなでしこリーグに参戦。チームカラーはオレンジ、シルフィードという名称は「風の妖精」という意味です。「スポーツを通じて地域を元気にする」ことを目標に活動しています。"},東京国際大学:{id:"tokaiD",name:"東京国際大学",shortName:"東京国際",category:"地域代表",region:"関東",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/15.html",introduction:"2013年に東京国際大学の強化クラブとして発足。今シーズンは「超えろ」をチームスローガンに掲げ、日々のトレーニングに励んでいます。一人一人がチームのために、そして支えてくださる方々への感謝を忘れずに戦い抜きます。"},"日テレ・東京メニーナ":{id:"ntokyo",name:"日テレ・東京メニーナ",shortName:"東京",category:"地域代表",region:"関東",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/17.html",introduction:"日テレ・東京ヴェルディベレーザの下部組織として活動しています。中学1年生から高校3年生までが所属しており、年齢や学年に捉われずに日々、競争の中でチームをつくっています。"},山梨学院大学:{id:"yamanashi",name:"山梨学院大学",shortName:"山梨",category:"地域代表",region:"関東",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/10.html",introduction:"2014年に創部し、今年で11年目を迎えます。Now is the time!～今がその時だ!～をチームスローガンとし、日々の練習に取り組んでいます。1試合1試合学生らしく、ひたむきに全力で戦います。"},神奈川大学:{id:"kanagawa",name:"神奈川大学",shortName:"神奈川",category:"地域代表",region:"関東",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/08.html",introduction:"｢青天霹靂｣を今年のスローガンとし、皆さんが驚くようなプレーで結果を残します。部員全員で縦・横のつながりを大切に、個人、チームの成長を目指します。また、この大会に参加できることに感謝し、全力で戦います。"},日本大学:{id:"nihon",name:"日本大学",shortName:"日本大",category:"地域代表",region:"関東",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/34.html",introduction:"2015年創部。「常に全力」「常に挑戦」「常に笑顔」をモットーに日大らしいサッカーでチーム一丸となり、一戦必勝、全力で挑みます。"},新潟医療福祉大学:{id:"niigata",name:"新潟医療福祉大学",shortName:"新潟医福",category:"地域代表",region:"北信越",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/20.html",introduction:"新潟医療福祉大学強化指定クラブとして2012年に発足。部員の多くは健康科学部健康スポーツ学科に在籍し、「健康医科学」「スポーツマネジメント」「スポーツ教育」の各コースを横断的に学んでいます。大学は開学以来、「優れたQOL（Quality Of Life）サポーターの教育」を基本理念とし、国内外で活躍する学生トップアスリートの育成に力を注いでいます。"},ヴィアティン三重レディース:{id:"mie",name:"ヴィアティン三重レディース",shortName:"三重",category:"地域代表",region:"東海",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/22.html",introduction:"2012年に男子トップチーム発足と同時にヴィアティンFCレディースとして発足しました。三重県の北勢地域を拠点に「子どもたちを笑顔に、地域とともに夢と感動を」というクラブ理念の下、「輝く女性のシンボル」というミッションも掲げ、活動しています。"},愛知東邦大学:{id:"aichitouho",name:"愛知東邦大学",shortName:"愛知東邦",category:"地域代表",region:"東海",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/40.html",introduction:"2007年の創部以来、「笑顔」と「感謝」を忘れずに日本一を目指し活動しているチームです。また、チーム以外の活動もし、日本一応援されるチームになれるように日々活動しています。"},明治国際医療大学:{id:"meiji",name:"明治国際医療大学",shortName:"明治医療",category:"地域代表",region:"関西",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/46.html",introduction:"部員50人を超える女子サッカー部で、笑顔爛漫なチームです。医療人としての学びを深めつつサッカーを楽しめる環境が大学にはあります。個人スキルのレベルアップを中心に活動を行っており、理解力・共働力・伝達力をベースに全員が主体性を持って行動できるチームを目指しています。"},岡山湯郷Belle:{id:"okayama",name:"岡山湯郷Belle",shortName:"岡山",category:"地域代表",region:"中国",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/30.html",introduction:"2001年に「スポーツといで湯の町」をキャッチフレーズに美人の湯として知られる湯郷温泉のある旧美作町に官民が一体となって誕生。Belleはフランス語で「美人」の意味。2024なでしこリーグ2部優勝の勢いのまま、皇后杯でも躍進します。"},吉備国際大学Charme岡山高梁:{id:"kibi",name:"吉備国際大学Charme岡山高梁",shortName:"吉備",category:"地域代表",region:"中国",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/27.html",introduction:"「Ｍy Best DREAM!（私の最高の夢）」をクラブスローガンとし、スポーツを通して地域社会の健康と文化を育み、笑顔で活気あふれる街づくりに貢献します。そして、スポーツの持つ力を信じて、夢や希望を抱き、人々と感動を共有します。"},ディオッサ出雲FC:{id:"izumo",name:"ディオッサ出雲FC",shortName:"出雲",category:"地域代表",region:"中国",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/03.html",introduction:"「神話の国 出雲から日本のなでしこへ」をキャッチフレーズに、なでしこリーグ参入への挑戦が出雲で始まりました。そして、2023シーズンに悲願の昇格を果たし、2024シーズンからなでしこリーグに参戦しています。ディオッサスタイルを貫き、躍動するフットボールを展開します。"},ディアヴォロッソ広島:{id:"hiroshima",name:"ディアヴォロッソ広島",shortName:"広島",category:"地域代表",region:"中国",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/39.html",introduction:"2019年に広島県熊野町に誕生したクラブです。ディアヴォロッソとは、イタリア語のディアヴォロ・ロッソの造語で、赤の持つエネルギッシュなイメージとともに、悪魔のように相手を翻弄し、ファンを魅了するチームでありたいという思いを込めています。"},AICJ高校:{id:"aicj",name:"AICJ高校",shortName:"AICJ",category:"地域代表",region:"中国",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/16.html",introduction:"AICJ高校は、生徒たちが日本の将来に大きく貢献するだけでなく、グローバルコミュニティーの一員として国際的に活躍できるエリートの育成を目指しています。サッカーにおいても全国高等学校総合体育大会と全日本高等学校女子サッカー選手権大会の二冠を目指しており、生徒は主体的に練習に励んでいます。"},FC今治レディース:{id:"imabari",name:"FC今治レディース",shortName:"今治",category:"地域代表",region:"四国",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/44.html",introduction:"現在なでしこリーグ2部に所属しています。「関わる人の心を大切にする。BESTを尽くす姿勢で関わる人の心を動かす。」という目標の下、活動を見た方々に、勇気や元気、希望を感じていただけるようにベストを尽くして戦います。"},鳴門渦潮高校:{id:"naruto",name:"鳴門渦潮高校",shortName:"鳴門",category:"地域代表",region:"四国",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/05.html",introduction:"「不撓不屈～やるなら本気～」をスローガンに、しんどいときこそ全員で立ち向かい、元気に明るく渦潮らしく一戦一戦、頑張ります。また、支えてくれている方々のために最後まで諦めず戦い続けます。"},"福岡J・アンクラス":{id:"fukuoka",name:"福岡J・アンクラス",shortName:"福岡",category:"地域代表",region:"九州",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/32.html",introduction:"アンクラスはスペイン語で「錨」の意味。1986年に福岡女学院中学・高校のサッカー部として始まった女子サッカーチームです。クラブエンブレムの「錨」マークは、福岡女学院の制服のマークに由来しています。"},秀岳館高校:{id:"shugakukan",name:"秀岳館高校",shortName:"秀岳館",category:"地域代表",region:"九州",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/28.html",introduction:"ポジショナルプレーにドリブルでの打開とワンタッチコンビネーションを融合させた、他にない秀岳館オリジナルスタイルで戦います。フットボールインテリジェンスをとにかく磨き、深みのあるフットボールを実現できるように取り組んでいます。"},神村学園高等部:{id:"kaminomura",name:"神村学園高等部",shortName:"神村",category:"地域代表",region:"九州",homeStadium:"NA",website:"https://www.jfa.jp/match/empressscup_2024/team_detail/04.html",introduction:"2年ぶり14回目の出場になります。国内の女子サッカー界における最も権威ある大会に出場できることをうれしく思います。全国の強豪チームとの対戦で多くの学びを得ることができるよう、高校生らしく、ひた向きにアグレッシブに戦います。"}},ma={M001:{id:"M001",round:"1",year:2024,date:"11/17",time:"10:30",venueId:"V001",short:"福井テクノ",name_jp:"テクノポート福井スタジアム",team1:"ディオッサ出雲FC",team2:"神村学園高等部",score:"3-2",status:"finished",category:"中国第3代表",category2:"九州第3代表",matchinfo:"https://www.jfa.jp/match/empressscup_2024/match_page/m1.html"},M002:{id:"M002",round:"1",year:2024,date:"11/17",time:"14:00",venueId:"V002",short:"栃木グ",name_jp:"栃木県グリーンスタジアム",team1:"東京国際大学",team2:"AICJ高校",score:"1-1(PK:5-3)",status:"finished",category:"関東第3代表",category2:"中国第5代表",matchinfo:"https://www.jfa.jp/match/empressscup_2024/match_page/m2.html"},M003:{id:"M003",round:"1",year:2024,date:"11/17",time:"13:30",venueId:"V001",short:"福井テクノ",name_jp:"テクノポート福井スタジアム",team1:"吉備国際大学Charme岡山高梁",team2:"秀岳館高校",score:"2-0",status:"finished",category:"中国第2代表",category2:"九州第2代表",matchinfo:"https://www.jfa.jp/match/empressscup_2024/match_page/m3.html"},M004:{id:"M004",round:"1",year:2024,date:"11/17",time:"11:00",venueId:"V002",short:"栃木グ",name_jp:"栃木県グリーンスタジアム",team1:"ディアヴォロッソ広島",team2:"愛知東邦大学",score:"1-0",status:"finished",category:"中国第4代表",category2:"東海第2代表",matchinfo:"https://www.jfa.jp/match/empressscup_2024/match_page/m4.html"},M005:{id:"M005",round:"2",year:2024,date:"11/23",time:"11:00",venueId:"V003",short:"Axis",name_jp:"Axisバードスタジアム",team1:"ヴィアマテラス宮崎",team2:"ディ